<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Pinterest Login</title>
    <link rel="stylesheet" href="../resources/css/styles.css">
</head>
<body>
    <div class="container">
        <img id="logo" src="https://upload.wikimedia.org/wikipedia/commons/0/08/Pinterest-logo.png" alt="Pinterest Logo">
        <h1 id="Titulo-login">Inicia Sesion para ver mas</h1>
        <form action="{{route('usuario-loggeado')}}" method="GET">
            <input class="nombres" type="text" name="nombres" placeholder="Nombre de Usuario" required>
            <input class="password" type="password" name="password" placeholder="Contraseña" required>
            <button id="btn-inicio-sesion" type="submit">Iniciar Sesión</button>
        </form>
        <div class="social-login-container">
            <button id="google-btn"><img class="imagen-redes"src="data:image/png;base64," alt="Iniciar con Google">Iniciar con Google</button>
            <button id="facebook-btn"><img class="imagen-redes" src="data:image/png;base64," alt="Iniciar con Facebook">Iniciar con Facebook</button>
        </div>
        <div class="extra-links">
            <a href="{{ route('usuario-registrarse') }}">Registrarse</a>
        </div>
    </div>
</body>
</html>

